import { Link } from 'react-router-dom';
import styled from 'styled-components';
import { ReactComponent as IncLogout } from '../../asserts/icons/icn_logout.svg';
import { ReactComponent as IncArrowLeft } from '../../asserts/icons/icn_arrow-left.svg';

const Container = styled.div`
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;
const H1 = styled.h1`
  margin: 0;
`;
const LinkStyled = styled(Link)`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 13px;
  margin-right: 8px;
  margin-left: 16px;
  text-decoration: none;
  color: var(--gray600);
  @media (min-width: 960px) {
    margin-right: 16px;
    margin-left: 16px;

    font-weight: 800;
    font-size: 16px;
    line-height: 24px;
    span {
      margin-left: 10px;
    }
  }
`;

export const HeaderOrdersList = () => {
  return (
    <Container>
      <LinkStyled to='/'>
        <IncArrowLeft /> <span>Назад</span>
      </LinkStyled>
      <H1>Мои заказы</H1>
      <LinkStyled to='/'>
        <IncLogout /> <span>Выйти</span>
      </LinkStyled>
    </Container>
  );
};
